import React, { useState } from 'react';

export default function (){

  function testSome(){
    var unirest = require("unirest");

var req = unirest("GET", "https://tumbimg.p.rapidapi.com/tumblr-image-search/");

req.headers({
	"x-rapidapi-host": "tumbimg.p.rapidapi.com",
	"x-rapidapi-key": "187617f10emsh0ce05444a7d10a2p10d6dcjsnbae35979548e",
	"useQueryString": true
});


req.end(function (res) {
	if (res.error) throw new Error(res.error);

	console.log(res.body);
});
  }

  return (
    <>
    <h1>Hello</h1>
    <button onClick={testSome}>CLICK</button>
    </>
  );
}
